import React, {useState} from 'react';

const Todo = () => {

    const [todo, setTodo] = useState()

    function Submit(e){
        e.preventDefault();

        console.log(todo.target.id)
    }

    return (
        <div>
            <form onSubmit={Submit}>
                <input onChange={()=> todo.target.id} type="text" />
                <button>click</button>
            </form>
            <ul className="list">
                <li className="item"></li>
            </ul>
        </div>
    );
}

export default Todo;
